import React from 'react';
import {Col} from "react-bootstrap";
import Card from "react-bootstrap/Card";
import star from '../assets/star.png'
import { Image } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';
import {DEVICE_ROUTE} from "../utils/consts"; // исправил здесь

const DeviceItem = ({device}) => {
    const history = useNavigate()
    return (
        <Col md={3} className="mt-3" onClick={() => history(DEVICE_ROUTE + '/' + device.id)}>
            <Card style={{width: 200, cursor: 'pointer'}} border={'light'}>
                <Image height={150} width={150} src={process.env.REACT_APP_API_URL + device.img}></Image>
                <div className="text-black-50 mt-1 d-flex justify-content-between">
                    <div>
                        samsung
                    </div>
                    <div className="d-flex align-items-center">
                        <div>
                            {device.rating}
                        </div>
                        <Image src={star} width={17}/>
                    </div>
                </div>
                <div>
                    {device.name}
                </div>
            </Card>
        </Col>
    );
};

export default DeviceItem;
